import { create } from 'zustand';

const usePrivateKeyStore = create((set) => ({
    privateKey: null,
    setPrivateKey: (key) => set({ privateKey: key }),
    clearPrivateKey: () => set({ privateKey: null }),
}));

export default usePrivateKeyStore;
